  true,\n\t\"url\": null,\n\t\"notes\": \"Occupational Health Record-keeping System
  (OHRS) is part of the Clinical Information Support System (CISS) portal framework
  and the initial CISS partner system.  OHRS is a web-based application that enables
  employee occupational health staff to create, maintain, and monitor medical records
  for VA employees and generate national, Veterans Integrated Service Network (VISN),
  and site-specific reports.The focus of OHRS is to collect clinical data for wellness,
  medical surveillance, and appropriate treatment of work-based injury or illness.
  OHRS will capture and store information on patient encounters, such as encounter
  type, purpose, status, provider, and other pertinent clinical data obtained during
  the patient visit. Users with appropriate security privileges are allowed to add
  and sign or co-sign the encounter and, if needed, perform scheduled and unscheduled
  reporting on items such as vaccination rates, vaccination and immunity statuses.
  The OHRS application does not share patient-specific data, but will collect data
  elements limited to information deemed critical to the Occupational Health delivery
  of care processes in the OHRS database. Employee data is obtained from the central
  Personnel and Accounting Integrated Data System (PAID) while volunteer information
  is obtained from the Voluntary Service System (VSS). Other Non-Paid and non-VSS
  data is collected by direct data entry into OHRS at the time of the patient encounter.
  OHRS is further designed to document, track and report immunizations administered
  to other Federal Agency employees outside of VA.\",\n\t\"license_title\": \"Creative
